import React from 'react'
import "./examCalanderBody.css";

export default function ExamCalanderBody() {
  return (
    <div>
      <div className="examCalanderBody">
        <div className="examCalanderBodyText"></div>
        <div className="examCalanderImg">
            <img src="/images/calander.jpg" alt="" />
        </div>
      </div>
    </div>
  )
}
